import React from 'react'
import { View, Text, StyleSheet } from 'react-native'

export default StyleSheet.create({
    buttons: {
        paddingVertical: 8,
        paddingHorizontal: 16,

        borderRadius: 30,
    },
    text: {
        fontSize: 15,
        fontWeight: '900',
    },
})
